var botclient = this.getDBM().Bot.bot.guilds
var name = [];
var servername = [];
var pagelimit = 30
var page = parseInt(tempVars("page"));
if (page === NaN) {
  msg.channel.send("**"+tempVars("page")+"** không phải là 1 số hợp lệ.")
} else {
  botclient.forEach(guild => {
    name.push(guild.name);
  })
  var length = name.length / pagelimit
  for (var i = 0; i < length; i++) {
    servername[i] = name.slice(0,pagelimit);
    name.splice(0,pagelimit)
  }
  if (servername.length < page) {
    msg.channel.send("Kết thúc danh sách server.")
  } else {
    page--
    this.storeValue(servername[page],1,"servername",cache);
    this.callNextAction(cache);
  }
}

